try {
    return $input.all().flatMap(item => {
        let rawText = item.json.output; // Extract AI response

        // Remove markdown-style ```json ... ```
        let cleanJson = rawText.replace(/^```json|```$/g, "").trim();

        // Parse JSON (handle errors safely)
        try {
            let parsedData = JSON.parse(cleanJson);

            // Ensure output is always an array (if it's an object, wrap it)
            let finalData = Array.isArray(parsedData) ? parsedData : [parsedData];

            // Wrap each item in `{ json: ... }`
            return finalData.map(entry => ({ json: entry }));
        } catch (parseError) {
            return [{ json: { error: "Invalid JSON from AI", rawData: rawText } }];
        }
    });
} catch (error) {
    return [{ json: { error: "Unexpected error", details: error.message } }];
}

// Process the data from HTML nodes
const items = $input.all();
const results = [];

// Iterate through all input items
for (let itemIndex = 0; itemIndex < items.length; itemIndex++) {
  const currentItem = items[itemIndex];

  if (currentItem.json && currentItem.json.propertyData && currentItem.json.propertyData.length > 0) {
    try {
      // Process each propertyData entry in the current item
      for (let dataIndex = 0; dataIndex < currentItem.json.propertyData.length; dataIndex++) {
        const rawJSON = currentItem.json.propertyData[dataIndex];

        if (typeof rawJSON !== 'string') {
          // Try to process as a structured object if not a string
          findAndProcessPropertyArrays(rawJSON, results, currentItem.json.page);
          continue;
        }

        // More comprehensive regex to catch all apartment listings
        // This looks for data structures that contain apartment information
        const propertyBlocks = rawJSON.match(/"@type":\s*(\["ApartmentComplex","Product"\]|\["Product","ApartmentComplex"\])[^}]*}[^}]*}/g);

        // If no matches found with primary pattern, try a broader approach
        if (!propertyBlocks || propertyBlocks.length === 0) {
          // Look for any product with price and name pattern, which are likely properties
          const altPattern = /"@type":\s*(\["[^"]*"\]|\["[^"]*","[^"]*"\])[^}]*"price":[^}]*"name":"[^"]*"[^}]*}/g;
          const altMatches = rawJSON.match(altPattern);

          if (altMatches && altMatches.length > 0) {
            console.log(`Found ${altMatches.length} properties with alternative pattern in item ${itemIndex}, propertyData ${dataIndex}`);
            // Process these matches
            for (const block of altMatches) {
              processPropertyBlock(block, results, currentItem.json.page);
            }
          } else {
            // Last resort: try to parse as JSON and extract structured data
            try {
              const jsonData = JSON.parse(rawJSON);
              // Look for arrays of items that might contain property listings
              findAndProcessPropertyArrays(jsonData, results, currentItem.json.page);
            } catch (jsonError) {
              console.log(`JSON parsing failed for item ${itemIndex}, propertyData ${dataIndex}:`, jsonError.message);
            }
          }
        } else {
          // Process standard property blocks
          console.log(`Found ${propertyBlocks.length} standard property blocks in item ${itemIndex}, propertyData ${dataIndex}`);
          for (const block of propertyBlocks) {
            processPropertyBlock(block, results, currentItem.json.page);
          }
        }
      }
    } catch (error) {
      // Log error information for this item
      console.log(`Failed to process item ${itemIndex}:`, error.message);
    }
  }
}

// Helper function to process a property block
function processPropertyBlock(block, results, page) {
  try {
    // Extract key data points using regex
    const nameMatch = block.match(/"name":"([^"]+)"/);
    const priceMatch = block.match(/"price":(\d+)/);
    const addressMatch = block.match(/"address":"([^"]+)"/);
    const descriptionMatch = block.match(/"description":"([^"]+)"/);
    const imageMatch = block.match(/"image":"([^"]+)"/);

    // Helper function to clean text
    const cleanText = (text) => {
      if (!text) return null;
      return text.replace(/\\n/g, ' ').replace(/\n/g, ' ').replace(/\s+/g, ' ').trim();
    };

    // Get the description text
    const descriptionText = descriptionMatch ? cleanText(descriptionMatch[1]) : '';

    // Determine property type based on description
    let propertyType = "Unknown";
    if (descriptionText.includes('1 BHK') || descriptionText.includes('1BHK') || descriptionText.includes('1-BHK') || descriptionText.includes('1 Bedroom')) {
      propertyType = "1BHK";
    } else if (descriptionText.includes('2 BHK') || descriptionText.includes('2BHK') || descriptionText.includes('2-BHK') || descriptionText.includes('2 Bedroom')) {
      propertyType = "2BHK";
    } else if (descriptionText.includes('3 BHK') || descriptionText.includes('3BHK') || descriptionText.includes('3-BHK') || descriptionText.includes('3 Bedroom')) {
      propertyType = "3BHK";
    } else if (descriptionText.includes('4 BHK') || descriptionText.includes('4BHK') || descriptionText.includes('4-BHK') || descriptionText.includes('4 Bedroom')) {
      propertyType = "4BHK";
    } else if (descriptionText.includes('5 BHK') || descriptionText.includes('5BHK') || descriptionText.includes('5-BHK') || descriptionText.includes('5 Bedroom')) {
      propertyType = "5BHK";
    }

    // Create property object with cleaned data
    const property = {
      propertyName: nameMatch ? cleanText(nameMatch[1]) : null,
      price: priceMatch ? parseInt(priceMatch[1]) : null,
      address: addressMatch ? cleanText(addressMatch[1]) : null,
      description: descriptionText ? (descriptionText.substring(0, 200) + (descriptionText.length > 200 ? '...' : '')) : null,
      image: imageMatch ? imageMatch[1] : null,
      type: propertyType,
      page: page || "unknown"
    };

    // Add location if possible
    const locationMatch = block.match(/"containedInPlace":{"name":"([^"]+)"/);
    if (locationMatch) {
      property.location = cleanText(locationMatch[1]);
    }

    // Add to results if it has minimum required fields
    if (property.propertyName || property.price) {
      results.push(property);
    }
  } catch (blockError) {
    // Skip this property if there's an issue
    console.log("Error processing property block:", blockError.message);
  }
}

// Function to recursively find and process property arrays in complex structures
function findAndProcessPropertyArrays(data, results, page) {
  if (!data) return;

  // If it's an array, check each item
  if (Array.isArray(data)) {
    for (const item of data) {
      findAndProcessPropertyArrays(item, results, page);
    }
    return;
  }

  // If it's an object, check if it looks like a property
  if (typeof data === 'object') {
    // Check if this object has property-like attributes
    if (data['@type'] && data.name && (data.price || data.offers)) {
      // Extract description text for property type detection
      const descriptionText = data.description || '';

      // Determine property type
      let propertyType = "Unknown";
      if (descriptionText.includes('1 BHK') || descriptionText.includes('1BHK') || descriptionText.includes('1-BHK') || descriptionText.includes('1 Bedroom')) {
        propertyType = "1BHK";
      } else if (descriptionText.includes('2 BHK') || descriptionText.includes('2BHK') || descriptionText.includes('2-BHK') || descriptionText.includes('2 Bedroom')) {
        propertyType = "2BHK";
      } else if (descriptionText.includes('3 BHK') || descriptionText.includes('3BHK') || descriptionText.includes('3-BHK') || descriptionText.includes('3 Bedroom')) {
        propertyType = "3BHK";
      } else if (descriptionText.includes('4 BHK') || descriptionText.includes('4BHK') || descriptionText.includes('4-BHK') || descriptionText.includes('4 Bedroom')) {
        propertyType = "4BHK";
      } else if (descriptionText.includes('5 BHK') || descriptionText.includes('5BHK') || descriptionText.includes('5-BHK') || descriptionText.includes('5 Bedroom')) {
        propertyType = "5BHK";
      }

      const property = {
        propertyName: data.name || null,
        price: data.price || (data.offers && data.offers.price) || null,
        address: typeof data.address === 'string' ? data.address : 
                (data.address && data.address.streetAddress) || null,
        description: data.description ? (data.description.substring(0, 200) + 
                    (data.description.length > 200 ? '...' : '')) : null,
        image: data.image || null,
        type: propertyType,
        page: page || "unknown"
      };

      // Add location if possible
      if (data.containedInPlace && data.containedInPlace.name) {
        property.location = data.containedInPlace.name;
      }

      // Add to results if it has minimum required fields
      if (property.propertyName || property.price) {
        results.push(property);
      }
    }

    // Recursively check all properties
    for (const key in data) {
      findAndProcessPropertyArrays(data[key], results, page);
    }
  }
}

// Return results with proper JSON formatting
return results.map(property => ({
  json: property
}));

